      | 4326 -> { ItemTypeData.id= 4326; name= "Research Abstract: Project Enigma"; published= true; description= "<b>Paper:</b> Project Enigma - The Jovian Empires<br>  <b>Lead Researcher:</b> Myyona<br>  <b>Contributors:</b> None<br>  <b>Summary:</b> The Jovian society was the first to recover after the closure of the EVE Gate, an event that caused a near-complete extinction of all human settlements in New Eden. Having existed for thousands of years since then, the Jovian Empire experienced peaks and falls long before any of the other currently existing empires even managed to establish themselves as spacefaring nations.     Being keen seekers of knowledge, the Jovians possess great insight on past events, though they do not share it freely and easily with outsiders. This paper looks into the documentation available on the history of the Jovian Empires in an attempt to better understand the Jove mentality and the current state of the Jovian society. Evidence gathered for the paper suggests that the recent lack of communication from Jovian officials, as well as their seeming inability to stop the fatal Jovian Disease, may signal that the current Jovian Empire is in decline.    <i>This abstract relates to research undertaken by the Arek'Jaalan Project.</i>    <i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>    <i>Further copies of this document can be obtained through the Arek'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>"; marketGroupId= None; groupId= 1141; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
